@dataclasses.dataclass
class DestinyDefinitionsDestinyInventoryItemDefinitionValue:
    r"""This defines an item's \\"Value\\". Unfortunately, this appears to be used in different ways depending on the way that the item itself is used.
    For items being sold at a Vendor, this is the default \"sale price\" of the item. These days, the vendor itself almost always sets the price, but it still possible for the price to fall back to this value. For quests, it is a preview of rewards you can gain by completing the quest. For dummy items, if the itemValue refers to an Emblem, it is the emblem that should be shown as the reward. (jeez louise)
    It will likely be used in a number of other ways in the future, it appears to be a bucket where they put arbitrary items and quantities into the item.
    """
    
    item_value: Optional[list[shared_destiny_destinyitemquantity.DestinyDestinyItemQuantity]] = dataclasses.field(default=None)
    r"""References to the items that make up this item's \\"value\\", and the quantity."""  
    value_description: Optional[str] = dataclasses.field(default=None)
    r"""If there's a localized text description of the value provided, this will be said description."""  
    

@dataclasses.dataclass
class DestinyDefinitionsDestinyInventoryItemDefinition:
    r"""So much of what you see in Destiny is actually an Item used in a new and creative way. This is the definition for Items in Destiny, which started off as just entities that could exist in your Inventory but ended up being the backing data for so much more: quests, reward previews, slots, and subclasses.
    In practice, you will want to associate this data with \"live\" item data from a Bungie.Net Platform call: these definitions describe the item in generic, non-instanced terms: but an actual instance of an item can vary widely from these generic definitions.
    """
    
    action: Optional[DestinyDefinitionsDestinyInventoryItemDefinitionAction] = dataclasses.field(default=None)
    r"""If the item can be \\"used\\", this block will be non-null, and will have data related to the action performed when using the item. (Guess what? 99% of the time, this action is \\"dismantle\\". Shocker)"""  
    allow_actions: Optional[bool] = dataclasses.field(default=None)
    r"""BNet may forbid the execution of actions on this item via the API. If that is occurring, allowActions will be set to false."""  
    animations: Optional[list[shared_destiny_definitions_animations_destinyanimationreference.DestinyDefinitionsAnimationsDestinyAnimationReference]] = dataclasses.field(default=None)
    r"""If any animations were extracted from game content for this item, these will be the definitions of those animations."""  
    background_color: Optional[DestinyDefinitionsDestinyInventoryItemDefinitionBackgroundColor] = dataclasses.field(default=None)
    r"""Sometimes, an item will have a background color. Most notably this occurs with Emblems, who use the Background Color for small character nameplates such as the \\"friends\\" view you see in-game. There are almost certainly other items that have background color as well, though I have not bothered to investigate what items have it nor what purposes they serve: use it as you will."""  
    breaker_type: Optional[int] = dataclasses.field(default=None)
    r"""Some weapons and plugs can have a \\"Breaker Type\\": a special ability that works sort of like damage type vulnerabilities. This is (almost?) always set on items by plugs."""  
    breaker_type_hash: Optional[int] = dataclasses.field(default=None)
    r"""Since we also have a breaker type definition, this is the hash for that breaker type for your convenience. Whether you use the enum or hash and look up the definition depends on what's cleanest for your code."""  
    class_type: Optional[int] = dataclasses.field(default=None)
    r"""We run a similarly weak-sauce algorithm to try and determine whether an item is restricted to a specific class. If we find it to be restricted in such a way, we set this classType property to match the class' enumeration value so that users can easily identify class restricted items.
    If you see a mis-classed item, please inform the developers in the Bungie API forum.
    """  
    collectible_hash: Optional[int] = dataclasses.field(default=None)
    r"""If this item has a collectible related to it, this is the hash identifier of that collectible entry."""  
    crafting: Optional[DestinyDefinitionsDestinyInventoryItemDefinitionCrafting] = dataclasses.field(default=None)
    r"""Recipe items will have relevant crafting information available here."""  
    damage_type_hashes: Optional[list[int]] = dataclasses.field(default=None)
    r"""Theoretically, an item can have many possible damage types. In *practice*, this is not true, but just in case weapons start being made that have multiple (for instance, an item where a socket has reusable plugs for every possible damage type that you can choose from freely), this field will return all of the possible damage types that are available to the weapon by default."""  
    damage_types: Optional[list[int]] = dataclasses.field(default=None)
    r"""This is the list of all damage types that we know ahead of time the item can take on. Unfortunately, this does not preclude the possibility of something funky happening to give the item a damage type that cannot be predicted beforehand: for example, if some designer decides to create arbitrary non-reusable plugs that cause damage type to change.
    This damage type prediction will only use the following to determine potential damage types:
    - Intrinsic perks
    - Talent Node perks
    - Known, reusable plugs for sockets
    """  
    default_damage_type: Optional[int] = dataclasses.field(default=None)
    r"""If the item has a damage type that could be considered to be default, it will be populated here.
    For various upsetting reasons, it's surprisingly cumbersome to figure this out. I hope you're happy.
    """  
    default_damage_type_hash: Optional[int] = dataclasses.field(default=None)
    r"""Similar to defaultDamageType, but represented as the hash identifier for a DestinyDamageTypeDefinition.
    I will likely regret leaving in the enumeration versions of these properties, but for now they're very convenient.
    """  
    display_properties: Optional[shared_destiny_definitions_common_destinydisplaypropertiesdefinition.DestinyDefinitionsCommonDestinyDisplayPropertiesDefinition] = dataclasses.field(default=None)
    r"""Many Destiny*Definition contracts - the \\"first order\\" entities of Destiny that have their own tables in the Manifest Database - also have displayable information. This is the base class for that display information."""  
    display_source: Optional[str] = dataclasses.field(default=None)
    r"""In theory, it is a localized string telling you about how you can find the item. I really wish this was more consistent. Many times, it has nothing. Sometimes, it's instead a more narrative-forward description of the item. Which is cool, and I wish all properties had that data, but it should really be its own property."""  
    does_postmaster_pull_have_side_effects: Optional[bool] = dataclasses.field(default=None)
    r"""The boolean will indicate to us (and you!) whether something *could* happen when you transfer this item from the Postmaster that might be considered a \\"destructive\\" action.
    It is not feasible currently to tell you (or ourelves!) in a consistent way whether this *will* actually cause a destructive action, so we are playing it safe: if it has the potential to do so, we will not allow it to be transferred from the Postmaster by default. You will need to check for this flag before transferring an item from the Postmaster, or else you'll end up receiving an error.
    """  
    emblem_objective_hash: Optional[int] = dataclasses.field(default=None)
    r"""If the item is an emblem that has a special Objective attached to it - for instance, if the emblem tracks PVP Kills, or what-have-you. This is a bit different from, for example, the Vanguard Kill Tracker mod, which pipes data into the \\"art channel\\". When I get some time, I would like to standardize these so you can get at the values they expose without having to care about what they're being used for and how they are wired up, but for now here's the raw data."""  
    equippable: Optional[bool] = dataclasses.field(default=None)
    r"""If true, then you will be allowed to equip the item if you pass its other requirements.
    This being false means that you cannot equip the item under any circumstances.
    """  
    equipping_block: Optional[DestinyDefinitionsDestinyInventoryItemDefinitionEquippingBlock] = dataclasses.field(default=None)
    r"""If this item can be equipped, this block will be non-null and will be populated with the conditions under which it can be equipped."""  
    flavor_text: Optional[str] = dataclasses.field(default=None)  
    gearset: Optional[DestinyDefinitionsDestinyInventoryItemDefinitionGearset] = dataclasses.field(default=None)
    r"""If this item has related items in a \\"Gear Set\\", this will be non-null and the relationships defined herein."""  
    hash: Optional[int] = dataclasses.field(default=None)
    r"""The unique identifier for this entity. Guaranteed to be unique for the type of entity, but not globally.
    When entities refer to each other in Destiny content, it is this hash that they are referring to.
    """  
    icon_watermark: Optional[str] = dataclasses.field(default=None)
    r"""If available, this is the original 'active' release watermark overlay for the icon. If the item has different versions, this can be overridden by the 'display version watermark icon' from the 'quality' block. Alternatively, if there is no watermark for the version, and the item version has a power cap below the current season power cap, this can be overridden by the iconWatermarkShelved property."""  
    icon_watermark_shelved: Optional[str] = dataclasses.field(default=None)
    r"""If available, this is the 'shelved' release watermark overlay for the icon. If the item version has a power cap below the current season power cap, it can be treated as 'shelved', and should be shown with this 'shelved' watermark overlay."""  
    index: Optional[int] = dataclasses.field(default=None)
    r"""The index of the entity as it was found in the investment tables."""  
    inventory: Optional[DestinyDefinitionsDestinyInventoryItemDefinitionInventory] = dataclasses.field(default=None)
    r"""If this item can exist in an inventory, this block will be non-null. In practice, every item that currently exists has one of these blocks. But note that it is not necessarily guaranteed."""  
    investment_stats: Optional[list[shared_destiny_definitions_destinyiteminvestmentstatdefinition.DestinyDefinitionsDestinyItemInvestmentStatDefinition]] = dataclasses.field(default=None)
    r"""If the item has stats, this block will be defined. It has the \\"raw\\" investment stats for the item. These investment stats don't take into account the ways that the items can spawn, nor do they take into account any Stat Group transformations. I have retained them for debugging purposes, but I do not know how useful people will find them."""  
    is_wrapper: Optional[bool] = dataclasses.field(default=None)
    r"""If true, this is a dummy vendor-wrapped item template. Items purchased from Eververse will be \\"wrapped\\" by one of these items so that we can safely provide refund capabilities before the item is \\"unwrapped\\"."""  
    item_category_hashes: Optional[list[int]] = dataclasses.field(default=None)
    r"""BNet attempts to make a more formal definition of item \\"Categories\\", as defined by DestinyItemCategoryDefinition. This is a list of all Categories that we were able to algorithmically determine that this item is a member of. (for instance, that it's a \\"Weapon\\", that it's an \\"Auto Rifle\\", etc...)
    The algorithm for these is, unfortunately, volatile. If you believe you see a miscategorized item, please let us know on the Bungie API forums.
    """  
    item_sub_type: Optional[int] = dataclasses.field(default=None)
