    item_type_display_name: Optional[str] = dataclasses.field(default=None)
    r"""The localized title/name of the item's type. This can be whatever the designers want, and has no guarantee of consistency between items."""  
    links: Optional[list[shared_links_hyperlinkreference.LinksHyperlinkReference]] = dataclasses.field(default=None)
    r"""If we added any help or informational URLs about this item, these will be those links."""  
    lore_hash: Optional[int] = dataclasses.field(default=None)
    r"""If the item has any related Lore (DestinyLoreDefinition), this will be the hash identifier you can use to look up the lore definition."""  
